import React from 'react';
import {BrowserRouter as Router, Route} from 'react-router-dom';
import Map from './Map';
import Login from './Login';


const App: React.FC = () => {
  return (
    <Router>
      <div className="App">
      <Route path="/">
        <Route path="/map" />
      </Route>
        <Route path="/login" Component={Login} />

      </div>
    </Router>
  );
}

export default App;
